import Container from 'react-bootstrap/Container';

function FooterComponent() {
    return (
        <footer className="py-5">
            <Container>
                <div className="row px-0">
                    <div className="col-12 col-md-6 pe-0 pe-md-5 ps-0">
                        <h6 className='display-6 fw-bolder'>Contacts</h6>
                        <p className='lead'>Feel free to contact me if you need assistance, collaboration or anything else! Please use the following contacts for professional purposes only and use social media for informal matters.</p>
                    </div>
                    <div className="col-12 col-md-6 ps-0 ps-md-5">
                        <h6 className='display-6 fw-bolder'>Socials</h6>
                        <p className='lead'>Get in touch with me and follow me on my socials so you don't miss my latest adventures!</p>
                    </div>
                </div>
            </Container>
        </footer>
    );
}

export default FooterComponent;
